// src/Components/Login.js
import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
//import './Login.css';

const Login = () => {
  const [users, setUsers] = useState([]);
  const [selectedUserId, setSelectedUserId] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    // Fetch users when component mounts
    fetch("http://localhost:8083/api/users")
      .then(response => response.json())
      .then(data => {
        setUsers(data);
      })
      .catch(error => {
        console.error('Error fetching users:', error);
      });
  }, []);

  const validateForm = (event) => {
    event.preventDefault();
    const selectedUserName = users.find(user => user.id === selectedUserId)?.name;

    if (selectedUserId) {
      alert(`Login successful! Welcome, ${selectedUserName}!`);
      navigate(`/stodo-details?username=${selectedUserName}&userid=${selectedUserId}`);
    } else {
      alert("Please select a user.");
    }
  };

  return (
    <div className="bg-danger bg-opacity-25 min-vh-100 d-flex flex-column justify-content-center align-items-center">
      <nav className="navbar1 w-100">
        <nav className="navbar navbar-expand-lg navbar-light">
          <a className="navbar-brand" href="#">
            <img src="./images/Screenshot 2024-05-21 at 8.07.57 PM.png" width="30" height="30" className="d-inline-block align-top" alt="" />
            Stay Organized
          </a>
          <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav">
              <li className="nav-item">
                <Link className="nav-link" to="/">Back</Link>
              </li>
            </ul>
          </div>
        </nav>
      </nav>
      <div className="container">
        <div className="row">
          <div className="col-md-6 mx-auto rounded shadow bg-white">
            <div className="m-5 text-center">
              <form className="m-5" onSubmit={validateForm}>
                <h2 style={{ textAlign: 'left' }}>Login</h2>
                <div className="mb-3">
                  <label className="form-label" htmlFor="loginUsername">Username</label>
                  <select id="userList" name="User" className="form-control" value={selectedUserId} onChange={(e) => setSelectedUserId(e.target.value)}>
                    <option value="">Select User</option>
                    {users.map(user => (
                      <option key={user.id} value={user.id}>{user.name}</option>
                    ))}
                  </select>
                </div>
                <div className="mb-3">
                  <label className="form-label" htmlFor="loginPassword">Password</label>
                  <input className="form-control" type="password" id="loginPassword" name="loginPassword" />
                </div>
                <br />
                <button type="submit" className="form-control btn btn-dark">Login</button>
                <br /><br />
                <div className="mb-3">
                  <p>Don't have an account? <Link to="/register">Register</Link></p>
                </div>
              </form>
            </div>
          </div>
          <div className="col-md-6">
            <div className="mt-5">
              <img src="images/undraw_login_re_4vu2.svg" alt="login" className="img-fluid p-5" />
            </div>
          </div>
        </div>
      </div>
      <footer className="w-100 text-center mt-auto">
        <p>Author: Vidhya V<br />
          <a href="mailto:vidhya-v@pluralsight.com">vidhya-v@pluralsight.com</a>
        </p>
        <div className="copyright-area">
          <div className="container">
            <div className="row">
              <div className="col-md-12">
                <p className="text-center"> &copy; 2024 - All rights reserved </p>
              </div>
            </div>
          </div>
        </div>
      </footer>
    </div>
  );
};

export default Login;
